import React from 'react';
import styled from "styled-components";

const Title = styled("p")`
font-family: Open Sans;
font-style: normal;
font-weight: bold;
font-size: 14px;
line-height: 19px;
color: #444444;
`;

const VehicleList = () => {
    return (
        <>
        <Title>Select Vehicle</Title>

        </>
    );
}

export default VehicleList;
